import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/layout/Header';
import Footer from './components/layout/Footer';
import HeroSection from './components/layout/HeroSection';
import MarqueeBrands from './components/layout/MarqueeBrands';
import BikeList from './components/layout/BikeList'; // Keep only one import
import BikeDetails from './components/layout/BikeDetails'; // Assuming you have this component
import CategoryPage from './components/layout/CategoryPage'; // Import the new component (named CategoryPage as requested)
import About from "./components/layout/About"; // Assuming this is needed
import Compare from "./components/layout/Compare"; // Assuming this is needed
import BrandDetails from './components/layout/BrandDetails'; // Assuming this is needed
imp
// import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <main>
          <Routes>
            <Route path="/" element={
              <>
                <HeroSection />
                <MarqueeBrands />
                {/* Removed the extra <main> tag and the duplicate BikeList */}
                {/* <main style={{ padding: '2rem' }}> */}
                  <BikeList /> {/* Use only one instance of BikeList */}
                  <CategoryPage /> {/* Add the new component here, below BikeList */}
                {/* </main> */}
              </>
            } />
            <Route path="/bike/:id" element={<BikeDetails />} /> {/* Example route for bike detail */}
            <Route path="/about" element={<About />} /> {/* Assuming this route exists */}
            <Route path="/compare" element={<Compare />} /> {/* Assuming this route exists */}
            <Route path="/brand/:brandId" element={<BrandDetails />} /> {/* Assuming this route exists */}
            {/* Add other routes as needed */}
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
